INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (3.414, "カリン", 1, 1000001, 0.0, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 62, -416.5, 190803, 1, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (3.099, "カリン", 2, 1000002, 0.0, "ミッションをクリアして、\n報酬をゲットしましょう！", 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 62, -416.5, 190803, 1, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (2.801, "カリン", 3, 1000003, 0.0, "受け取ることができる\n報酬があるようです\n確認してみてください", 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 63, -416.5, 190803, 1, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (0.0, "カリン", 4, 1000004, 0.0, "報酬がもらえますよ！\nチェックしてみてください", 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 63, -416.5, 190803, 1, 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (2.12, "カリン", 5, 1000005, 0.0, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 1, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 64, -363.0, 190803, 1, 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1.68, "カリン", 6, 1000006, 0.0, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 64, -363.0, 190803, 1, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (2.33, "カリン", 7, 1000007, 0.0, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 1, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 64, -363.0, 190803, 1, 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (5.18, "ラビリスタ", 101, 1020101, -6.0, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 7, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 61, -285.0, 133701, 10201, 3);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (8.77, "クリスティーナ", 201, 1020102, -2.0, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 61, -285.0, 133901, 10201, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (15.5, "ネネカ", 301, 1020103, 0.0, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 1, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 61, -285.0, 133801, 10201, 6);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (9.061, "ランファ", 101, 1020201, 0.0, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 5, "2030/01/01 14:59:59", "2025/02/28 12:00:00", 61, -285.0, 134301, 10202, 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (7.699, "チカ", 201, 1020202, 0.0, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 2, "2030/01/01 14:59:59", "2025/02/28 12:00:00", 61, -285.0, 134401, 10202, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (8.595, "アオイ", 101, 1020301, 0.0, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 2, "2030/01/01 14:59:59", "2025/03/31 12:00:00", 61, -285.0, 134601, 10203, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (7.758, "クローチェ", 201, 1020302, 0.0, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 2, "2030/01/01 14:59:59", "2025/03/31 12:00:00", 61, -285.0, 134501, 10203, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (7.0, "ルイズマリー", 101, 1020401, 0.0, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 6, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 61, -285.0, 132302, 10204, 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (7.904, "イロハ", 201, 1020402, 0.0, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 2, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 61, -285.0, 132402, 10204, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (8.487, "ソノ", 301, 1020403, 0.0, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 2, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 61, -285.0, 132502, 10204, 4);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (8.763, "カノン", 101, 1020502, 0.0, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 2, "2030/01/01 14:59:59", "2025/05/31 12:00:00", 61, -285.0, 134901, 10205, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (6.417, "ツムギ", 201, 1020503, 0.0, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 3, "2030/01/01 14:59:59", "2025/05/31 12:00:00", 61, -285.0, 134801, 10205, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (10.335, "エリス", 101, 1020601, 0.0, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 7, "2030/01/01 14:59:59", "2025/06/30 12:00:00", 61, -285.0, 135001, 10206, 3);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (6.281, "シェフィ", 201, 1020602, 0.0, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 4, "2030/01/01 14:59:59", "2025/06/30 12:00:00", 61, -285.0, 135101, 10206, 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (12.244, "プレシア", 301, 1020603, 0.0, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 2, "2030/01/01 14:59:59", "2025/06/30 12:00:00", 61, -285.0, 135201, 10206, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (6.339, "クリア", 101, 1020701, 0.0, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 8, "2030/01/01 14:59:59", "2025/07/31 12:00:00", 61, -285.0, 135301, 10207, 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (8.184, "アネモネ", 201, 1020702, 0.0, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 9, "2030/01/01 14:59:59", "2025/07/31 12:00:00", 61, -285.0, 135401, 10207, 7);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (3.906, "アイラ", 101, 1020801, 0.0, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 2, "2030/01/01 14:59:59", "2025/08/31 12:00:00", 61, -285.0, 129101, 10208, 9);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (14.465, "シナツ", 201, 1020802, 0.0, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 2, "2030/01/01 14:59:59", "2025/08/31 12:00:00", 61, -285.0, 129201, 10208, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (8.662, "ヒヨリ", 301, 1020803, 0.0, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 3, "2030/01/01 14:59:59", "2025/08/31 12:00:00", 61, -285.0, 100101, 10208, 4);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (10.915, "レイ", 401, 1020804, 0.0, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 3, "2030/01/01 14:59:59", "2025/08/31 12:00:00", 61, -285.0, 100301, 10208, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (6.042, "ユキノ", 101, 1020901, 0.0, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 7, "2030/01/01 14:59:59", "2025/09/30 12:00:00", 61, -285.0, 135802, 10209, 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (9.402, "サツキ", 201, 1020902, 0.0, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 1, "2030/01/01 14:59:59", "2025/09/30 12:00:00", 61, -285.0, 135903, 10209, 4);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (8.16, "ルルィ", 301, 1020903, 0.0, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 1, "2030/01/01 14:59:59", "2025/09/30 12:00:00", 61, -285.0, 136902, 10209, 8);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (5.0, "カスミ", 101, 1021001, 0.0, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 2, "2030/01/01 14:59:59", "2025/10/31 12:00:00", 61, -285.0, 137401, 10210, 3);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (8.12, "アラクネ", 201, 1021002, 0.0, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 1, "2030/01/01 14:59:59", "2025/10/31 12:00:00", 61, -285.0, 136001, 10210, 4);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (6.386, "ナーナ", 301, 1021003, 0.0, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 2, "2030/01/01 14:59:59", "2025/10/31 12:00:00", 61, -285.0, 136202, 10210, 4);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (7.438, "ユイ", 101, 1021101, 0.0, "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 4, "2030/01/01 14:59:59", "2025/11/30 12:00:00", 61, -285.0, 136402, 10211, 3);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (8.35, "ミソラ", 201, 1021102, 0.0, "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 5, "2030/01/01 14:59:59", "2025/11/30 12:00:00", 61, -285.0, 136302, 10211, 1);
